"Rzheng1232","name":"Ryan zheng","avatar_template":"/user_avatar/www.chiefdelphi.com/rzheng1232/{size}/182897_2.png"},"bookmarked":false,"actions_summary":[],"moderator":false,"admin":false,"staff":false,"user_id":33946,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":"6995A/Choreo/Monologue"},"post_url":"/t/startend-command-or-runcommand/426445/4","custom_user_title":"6995A/Choreo/Monologue","reactions":[],"current_user_reaction":null,"reaction_users_count":0,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3143771,"name":"Ryan zheng","username":"Rzheng1232","avatar_template":"/user_avatar/www.chiefdelphi.com/rzheng1232/{size}/182897_2.png","created_at":"2023-02-11T18:37:05.434Z","cooked":"<p>Oh, ok thanks, that helped me clarify what the started command did.</p>","post_number":5,"post_type":1,"posts_count":13,"updated_at":"2023-02-11T18:37:05.434Z","reply_count":0,"reply_to_post_number":4,"quote_count":0,"incoming_link_count":5,"reads":100,"readers_count":99,"score":45.0,"yours":false,"topic_id":426445,"topic_slug":"startend-command-or-runcommand","display_username":"Ryan zheng","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":null,"reply_to_user":{"id":33946,"username":"Amicus1","name":"Amicus1","avatar_template":"/letter_avatar_proxy/v4/letter/a/a9adbd/{size}.png"},"bookmarked":false,"actions_summary":[],"moderator":false,"admin":false,"staff":false,"user_id":55168,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":"Programmer"},"post_url":"/t/startend-command-or-runcommand/426445/5","custom_user_title":"Programmer","reactions":[],"current_user_reaction":null,"reaction_users_count":0,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3163502,"name":"roborb","username":"roborb","avatar_template":"/letter_avatar_proxy/v4/letter/r/ecccb3/{size}.png","created_at":"2023-03-13T14:48:25.944Z","cooked":"<p>Hi, I have a similar question.  Hope you can clarify.  Are the following two methods equivalent functionally?  If so, is one method better than the other from execution efficiency or accuracy point of view?</p>
<pre><code class="lang-auto">  public CommandBase rotateDownTo_startEnd(double angle) {
    return this.startEnd(() -&gt; m_motor.set(IntakeArmConstants.kArmDownSpeed),
                        () -&gt; m_motor.set(0.0))
                .until(() -&gt; m_encoder.getPosition() &lt; angle);
  }
  public CommandBase rotateDownTo_run(double angle) {
    return this.run(() -&gt; m_motor.set(IntakeArmConstants.kArmDownSpeed))
              .until(() -&gt; m_encoder.getPosition() &lt; angle)
              .andThen(() -&gt; m_motor.set(0.0));
  }
</code></pre>
<p>Thank you for your time.</p>","post_number":6,"post_type":1,"posts_count":13,"updated_at":"2023-03-13T14:48:25.944Z","reply_count":2,"reply_to_post_number":2,"quote_count":0,"incoming_link_count":6,"reads":82,"readers_count":81,"score":56.4,"yours":false,"topic_id":426445,"topic_slug":"startend-command-or-runcommand","display_username":"roborb","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":"","reply_to_user":{"id":12381,"username":"Oblarg","name":"Eli Barnett","avatar_template":"/user_avatar/www.chiefdelphi.com/oblarg/{size}/161674_2.png"},"bookmarked":false,"actions_summary":[],"moderator":false,"admin":false,"staff":false,"user_id":30609,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"post_url":"/t/startend-command-or-runcommand/426445/6","custom_user_title":null,"reactions":[],"current_user_reaction":null,"reaction_users_count":0,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3163518,"name":"Eli Barnett","username":"Oblarg","avatar_template":"/user_avatar/www.chiefdelphi.com/oblarg/{size}/161674_2.png","created_at":"2023-03-13T15:03:38.785Z","cooked":"<p>The two aren’t quite the same, but would be essentially equivalent if you changed <code>run</code> to <code>runOnce</code>.</p>
<p>Do whatever you find easier to read (I personally prefer the <code>runOnce/until</code> declaration, because it keeps the order of the lambdas in the order they actually occur); the performance differences are negligible (from a purely performance perspective, writing a <code>Command</code> subclass directly is the best you can do - but this is easily the worst choice from a readability perspective).</p>
<p>As a rule, efficiency of the <em>scheduling</em> code isn’t super important, because scheduling is (or should be, if your code is structured well) a relatively infrequent event.  So, it does not really matter how we compose our commands; the performance cost should come mostly from the user code inside those commands, not from the framework compositions that let us glue them together.  So, you should prioritize clarity and readability when deciding how to use the framework composition tools, and mostly only worry about efficiency in your implementations.</p>","post_number":7,"post_type":1,"posts_count":13,"updated_at":"2023-03-13T15:11:06.654Z","reply_count":2,"reply_to_post_number":6,"quote_count":0,"incoming_link_count":2,"reads":74,"readers_count":73,"score":34.8,"yours":false,"topic_id":426445,"topic_slug":"startend-command-or-runcommand","display_username":"Eli Barnett","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":2,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":"","reply_to_user":{"id":30609,"username":"roborb","name":"roborb","avatar_template":"/letter_avatar_proxy/v4/letter/r/ecccb3/{size}.png"},"bookmarked":false,"actions_summary":[],"moderator":false,"admin":false,"staff":false,"user_id":12381,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":"Robot apartments! invisible suburbs! skeleton treasuries!"},"post_url":"/t/startend-command-or-runcommand/426445/7","custom_user_title":"Robot apartments! invisible suburbs! skeleton treasuries!","reactions":[],"current_user_reaction":null,"reaction_users_count":0,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3163540,"name":"roborb","username":"roborb","avatar_template":"/letter_avatar_proxy/v4/letter/r/ecccb3/{size}.png","created_at":"2023-03-13T15:31:29.421Z","cooked":"<p>Thank you for the explanation!  It makes sense to use runOnce instead of startEnd for readability.</p>","post_number":8,"post_type":1,"posts_count":13,"updated_at":"2023-03-13T15:31:29.421Z","reply_count":1,"reply_to_post_number":7,"quote_count":0,"incoming_link_count":3,"reads":61,"readers_count":60,"score":47.2,"yours":false,"topic_id":426445,"topic_slug":"startend-command-or-runcommand","display_username":"roborb","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":"","reply_to_user":{"id":12381,"username":"Oblarg","name":"Eli Barnett","avatar_template":"/user_avatar/www.chiefdelphi.com/oblarg/{size}/161674_2.png"},"bookmarked":false,"actions_summary":[{"id":2,"count":1}],"moderator":false,"admin":false,"staff":false,"user_id":30609,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"post_url":"/t/startend-command-or-runcommand/426445/8","custom_user_title":null,"reactions":[{"id":"heart","type":"emoji","count":1}],"current_user_reaction":null,"reaction_users_count":1,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3163548,"name":"Eli Barnett","username":"Oblarg","avatar_template":"/user_avatar/www.chiefdelphi.com/oblarg/{size}/161674_2.png","created_at":"2023-03-13T15:39:45.162Z","cooked":"<p>Note also that you can use <code>finallyDo</code> instead of <code>andThen</code> to make sure that the last action occurs even if the command is externally interrupted.</p>","post_number":9,"post_type":1,"posts_count":13,"updated_at":"2023-03-13T15:39:45.162Z","reply_count":0,"reply_to_post_number":8,"quote_count":0,"incoming_link_count":0,"reads":56,"readers_count":55,"score":41.2,"yours":false,"topic_id":426445,"topic_slug":"startend-command-or-runcommand","display_username":"Eli Barnett","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":"","reply_to_user":{"id":30609,"username":"roborb","name":"roborb","avatar_template":"/letter_avatar_proxy/v4/letter/r/ecccb3/{size}.png"},"bookmarked":false,"actions_summary":[{"id":2,"count":2}],"moderator":false,"admin":false,"staff":false,"user_id":12381,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":"Robot apartments! invisible suburbs! skeleton treasuries!"},"post_url":"/t/startend-command-or-runcommand/426445/9","custom_user_title":"Robot apartments! invisible suburbs! skeleton treasuries!","reactions":[{"id":"heart","type":"emoji","count":2}],"current_user_reaction":null,"reaction_users_count":2,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3168510,"name":"roborb","username":"roborb","avatar_template":"/letter_avatar_proxy/v4/letter/r/ecccb3/{size}.png","created_at":"2023-03-20T15:16:44.315Z","cooked":"<aside class="quote no-group quote-modified" data-username="roborb" data-post="6" data-topic="426445">
<div class="title">
