<img loading="lazy" alt="" width="24" height="24" src="https://www.chiefdelphi.com/letter_avatar_proxy/v4/letter/r/ecccb3/48.png" class="avatar"> roborb:</div>
<blockquote>
<pre><code class="lang-auto">  public CommandBase rotateDownTo_run(double angle) {
    return this.runOnce(() -&gt; m_motor.set(IntakeArmConstants.kArmDownSpeed))
              .until(() -&gt; m_encoder.getPosition() &lt; angle)
              .andThen(() -&gt; m_motor.set(0.0));
  }
</code></pre>
</blockquote>
</aside>
<p>If I use runOnce(), does the scheduler keep the command in queue for multiple 20ms cycles to check for the .until condition ?  Or does it just check the .until condition in the first 20ms cycle and dequeue the whole command without executing .andThen part if that .until condition is not met?  In other words, does the .until decorator force the command to be in the scheduler queue even though .runOnce implies a one time action?</p>","post_number":10,"post_type":1,"posts_count":13,"updated_at":"2023-03-20T15:17:48.338Z","reply_count":1,"reply_to_post_number":7,"quote_count":1,"incoming_link_count":1,"reads":45,"readers_count":44,"score":19.0,"yours":false,"topic_id":426445,"topic_slug":"startend-command-or-runcommand","display_username":"roborb","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":"","reply_to_user":{"id":12381,"username":"Oblarg","name":"Eli Barnett","avatar_template":"/user_avatar/www.chiefdelphi.com/oblarg/{size}/161674_2.png"},"bookmarked":false,"actions_summary":[],"moderator":false,"admin":false,"staff":false,"user_id":30609,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"post_url":"/t/startend-command-or-runcommand/426445/10","custom_user_title":null,"reactions":[],"current_user_reaction":null,"reaction_users_count":0,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3168513,"name":"Eli Barnett","username":"Oblarg","avatar_template":"/user_avatar/www.chiefdelphi.com/oblarg/{size}/161674_2.png","created_at":"2023-03-20T15:19:06.746Z","cooked":"<p><code>runOnce</code> terminates immediately after a single iteration of the scheduler; the <code>until</code> will be useless unless you do something else to extend the lifespan of the command (e.g. <code>andThen(run(() -&gt; {}))</code>).</p>
